import asyncio

from config_fastapi import settings
from src.core.storage_bunny import BunnyStorage

bunny_storage = BunnyStorage(api_key=settings.BUNNY_API_KEY,
                             storage_name=settings.BUNNY_STORAGE_NAME,
                             storage_region=settings.BUNNY_STORAGE_REGION)


async def check_upload_file():
    return await bunny_storage.upload_image_to_bunny(base64photo='data:image/png;base64,')


if __name__ == "__main__":
    asyncio.run(check_upload_file())
